import './ExpenseItem.css'

// A Component in React is a javascript function
function ExpenseItem() {
    return (
        <div class="expense-item">
            <div>March 28th 2021</div>
            <div>
                <h2>Car Insurance</h2>
                <div>$249.67</div>
            </div>
        </div>
    );
}

export default ExpenseItem;
